css:
.highlight.ocaml-merlin .region {
  border-bottom: 1px solid #0f82e6;
}
atom-overlay.ocaml-merlin {
  z-index: 100;
}
.ocaml-merlin-type {
  background-color: #252830;
  border-left: 0.5rem solid #181a1f;
  border-radius: 3px;
  box-shadow: 2px 2px 2px #1a1c21;
}
.ocaml-merlin-type atom-text-editor {
  box-sizing: content-box;
  padding: 0.75rem !important;
  box-shadow: none !important;
  border: none !important;
  font-size: inherit !important;
  background-color: #252830 !important;
  max-height: none !important;
  height: auto !important;
}
.ocaml-merlin-type .cursors {
  display: none;
}
